import styles from './LeadsActions.module.css';
const LeadActions = () => {

    return (
        <div className={styles["lead-actions"]}>
            <div>
                <h2>Leads</h2>
            </div>
            <div>
                <button className={styles.btn}>Add Lead</button>
            </div>
        </div>
    )

}

export default LeadActions;
